import React from 'react';
import possibilityImage from '../../assets/possibility.png'

const Possibility = () => {
    return (
        <div className='gpt3__possibility section__padding' id="possibility">
            <div className='gpt3__possibility-image'>
                <img src={possibilityImage} alt="possibilityImage" />
            </div>
            <div className='gpt3__possibility-content'>
                <h4>Lorem ipsum, dolor sit amet consectetur adipisicing elit. Architecto, ipsa!</h4>
                <h1 className='gradient__text'>The possibilties are beyond your imagination</h1>
                <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Error minima beatae aut quos. In, explicabo temporibus! Pariatur dolore ratione facilis, perferendis ipsam adipisci assumenda dicta voluptatem eligendi, distinctio esse sed!</p>
            </div>
        </div>
    );
};

export default Possibility;
